import { FontAwesomeIcon } from "@fortawesome/free-regular-svg-icons";
import { faNewspaper } from "@fortawesome/free-regular-svg-icons";

const NewspaperIcon = () => {
  return (
    <div>
      <FontAwesomeIcon icon={faNewspaper}></FontAwesomeIcon>
    </div>
  );
};

export default NewspaperIcon;
